Kidulthood (2006)  

Verenigd Koninkrijk
Drama
89 minuten

geregisseerd door Menhaj Huda
met Aml Ameen, Red Madrell en Noel Clarke

Voor Trife, een 15 jarige jongen uit Westend in Londen, is het leven elke dag een strijd. Gevangen tussen de wereld van zijn vrienden op school, het meisje waar hij van houdt en zijn sterke en gevaarlijke oom, moet Trife kiezen tussen het pad waarvan hij weet dat het goed is of een leven met wapens, drugs en geweld, wat hij al te goed kent.

